import React from 'react';

const StudentList = ({ children }) => {
  // You can fetch the list of students from an API or props
  const students = [
    { id: 1, name: 'Student A' },
    { id: 2, name: 'Student B' },
    // ... more students
  ];

  return <div>{children(students)}</div>;
};

export default StudentList;
